var left_side_width = 220; //Sidebar width in pixels


$(function() {
    "use strict";
    $.ajaxSetup({
        headers: {
            'X-CSRF-TOKEN': $('meta[name="csrf-token"]').attr('content')
        }
    });
    setTimeout(function() {
        $("#notification_remove").remove();
    }, 5000);

    $(function() {
        //hide menu in small screens
        if ($(window).width() <= 992) {
            $(".wrapper").addClass("hide_menu");
            $("body").removeClass("mini_sidebar");
            $("body").addClass("left-hidden");
        }
        //Enable sidebar toggle
        $("[data-toggle='offcanvas'].sidebar-toggle").on('click', function(e) {
            e.preventDefault();
            $("body").toggleClass("left-hidden");
            //Toggle Menu
            if (!$("body").hasClass("mini_sidebar")) {
                $(".wrapper").toggleClass("hide_menu");
            }
        });
        //leftmenu init
        // $('#menu').metisMenu();
        // INIT popovers
        $("[data-toggle='popover']").popover();
    });


    //Add hover support for touch devices
    $('.btn').bind('touchstart', function() {
        $(this).addClass('hover');
    }).bind('touchend', function() {
        $(this).removeClass('hover');
    });

    //Activate tooltips
    $("[data-toggle='tooltip']").tooltip();

    /*
     * Add collapse and remove events to boxes
     */
    $("[data-widget='collapse']").click(function() {
        //Find the box parent
        var box = $(this).parents(".box").first();
        //Find the body and the footer
        var bf = box.find(".box-body, .box-footer");
        if (!box.hasClass("collapsed-box")) {
            box.addClass("collapsed-box");
            bf.slideUp();
        } else {
            box.removeClass("collapsed-box");
            bf.slideDown();
        }
    });

    /*
     * ADD SLIMSCROLL TO THE TOP NAV DROPDOWNS
     * ---------------------------------------
     */
    // $(".navbar .menu").slimscroll({
    //     height: "200px",
    //     alwaysVisible: true,
    //     size: "3px"
    // }).css("width", "100%");

    /*
     * INITIALIZE BUTTON TOGGLE
     * ------------------------
     */

    $('.btn-group[data-toggle="btn-toggle"]').each(function() {
        var group = $(this);
        $(this).find(".btn").click(function(e) {
            group.find(".btn.active").removeClass("active");
            e.preventDefault();
        });
    });

    $("[data-widget='remove']").click(function() {
        //Find the box parent
        var box = $(this).parents(".box").first();
        box.slideUp();
    });

});

