//Back to top code
$(document).ready(function(){
    $(window).scroll(function () {
        if ($(this).scrollTop() > 50) {
            $('#back-to-top').fadeIn();
        } else {
            $('#back-to-top').fadeOut();
        }
    });
    // scroll body to 0px on click
    $('#back-to-top').click(function () {
        $('#back-to-top').tooltip('hide');
        $('body,html').animate({
            scrollTop: 0
        }, 800);
        return false;
    });

    $('#back-to-top').tooltip('show');
});
//color switcher code
$(function () {
    //BEGIN THEME SETTING
    $('#theme-setting > a.btn-theme-setting').click(function(){
        if($('#theme-setting').css('right') < '0'){
            $('#theme-setting').css('right', '0');
        } else {
            $('#theme-setting').css('right', '-250px');
        }
    });
    $('#white').click(function(){
//		alert('white clicked');
        $("#colorscheme" ).attr("href", "css/styles/white.css" );

    });
    $('#blacks').click(function(){
//		alert('black clicked');		
        $("#colorscheme" ).attr("href", "css/styles/black.css" );
    });
    // Begin Change Theme Color
});


//Code for collpasing panels

$(document).on('click', '.panel-heading .removepanel', function(){
    var $this = $(this);
    $this.parents('.panel').hide("slow");
});
//panel hide
$('.showhide').attr('title','Hide Panel content');
$(document).on('click', '.panel-heading .clickable', function(e){
    var $this = $(this);
    if(!$this.hasClass('panel-collapsed')) {
        $this.parents('.panel').find('.panel-body').slideUp();
        $this.addClass('panel-collapsed');
        $this.find('i').removeClass('material-icons').text("keyboard_arrow_up").addClass('material-icons').text("keyboard_arrow_down");
        $('.showhide').attr('title','Show Panel content');
    } else {
        $this.parents('.panel').find('.panel-body').slideDown();
        $this.removeClass('panel-collapsed');
        $this.find('i').removeClass('material-icons').text("keyboard_arrow_down").addClass('material-icons').text("keyboard_arrow_up");
        $('.showhide').attr('title','Hide Panel content');
    }
});
